(function(window,undefined){var UnlicheSDK={};if(window.UnlicheSDK){return}window.UnlicheSDK=UnlicheSDK;UnlicheSDK.init=function(APIKey,mode,callback){loadScript("https://s3-ap-southeast-1.amazonaws.com/app.unliche.com/unlichewebsdk/V3/lib/MethodHelper.min.js",APIKey,mode)};window.onload=function(){UnlicheSDK.savePageInfo(document.URL)};UnlicheSDK.trackEvent=function(){if(arguments.length==1){UnlicheSDK.listen(arguments[0])}else{UnlicheSDK.listen(arguments[0],arguments[1])}};UnlicheSDK.trackTransaction=function(){if(arguments.length==1){UnlicheSDK.transactionListen(arguments[0])}else{UnlicheSDK.transactionListen(arguments[0],arguments[1])}};UnlicheSDK.getIdForGA=function(){var GAIdForWeb=getParameterByName("trck_id");if(GAIdForWeb==null||GAIdForWeb==""){GAIdForWeb=UnlicheSDK.getGAId();if(GAIdForWeb.indexOf("&transaction_id")!==-1){GAIdForWeb=GAIdForWeb.split("&transaction_id")[0]}}else{if(GAIdForWeb.indexOf("&transaction_id")!==-1){GAIdForWeb=GAIdForWeb.split("&transaction_id")[0]}}return GAIdForWeb};UnlicheSDK.getSubLeadId=function(){var subLeadId=getParameterByName("sub_lead_id");if(subLeadId==null||subLeadId==""){subLeadId=UnlicheSDK.getSubleadId();if(subLeadId.indexOf("&")!==-1){subLeadId=subLeadId.split("&")[0]}}else{if(subLeadId.indexOf("&")!==-1){subLeadId=subLeadId.split("&")[0]}}return subLeadId};UnlicheSDK.setUserId=function(userID){UnlicheSDK.setUserIdForMultitouch(userID)};function loadScript(url,apiKey,mode,callback){var imported=document.createElement("script");imported.src=url;document.head.appendChild(imported);window.addEventListener("load",function(){UnlicheSDK.saveBrowserInfo(apiKey,mode)})}function getParameterByName(name){var url_string=document.URL;var url=new URL(url_string);var value=url.searchParams.get(name);return value}})(this);
